<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Title</title>
</head>
<body>
<script>
/**
 * @param {number} n
 * @return {number[]}
 */
var printNumbers = function(n) {
  return new Array(Math.pow(10, n) - 1).fill(0).map((item, index) => index + 1);
};
</script>
</body>
